import { useEffect, useState } from 'react';

export default function Donnees() {
    const [donnee1,donnee2] = useState();

    useEffect(() => {
        fetch('http://localhost:8081/?pollutionHourtin=85').then((response) => response.json()).then((data) => {
            donnee2(data['hourtin_values']['pollutionHourtin'])
            console.log(data['hourtin_values']['pollutionHourtin']);
        });
    }, []);

    return (
        <h1> {donnee1.map()} </h1>
    );
}
